import React from 'react';
import Container from '@mui/material/Container';
import Box from '@mui/material/Box';
import Typography from '@mui/material/Typography';

export default function Home() {
  return (
    <div className='home'>
      <Container>
          <Box sx={{display:'flex',flexWrap:'wrap',justifyContent:'space-between'}}>
          <Box>
            <img src='https://images.unsplash.com/photo-1523821757808-8c895a0aba06?q=80&w=2070&auto=format&fit=crop&ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8fA%3D%3D' alt='hero' height="440px" width="700px" />
          </Box>
          <Box>
              <Typography variant='h6'>Welcome To</Typography>
              <Typography variant='h2'>Payakan Store</Typography>
          </Box>
          </Box>
      </Container>
    </div>
  )
}
